import Button from "../../../../UI/Button";
import InputText from "../../../../UI/InputText/InputText";
import style from "./SettingAccount.module.css";

function SettingAccount(props) {
  return (
    <form className={style.form}>
      <InputText
        id="name"
        label="name"
        type="text"
        classInput={style.input}
        classLabel={style.label}
        classInputContainer={style["form__list"]}
      />
      <InputText
        id="email"
        label="email"
        type="email"
        classInput={style.input}
        classLabel={style.label}
        classInputContainer={style["form__list"]}
      />
      <InputText
        id="password"
        label="password"
        type="password"
        classInput={style.input}
        classLabel={style.label}
        classInputContainer={style["form__list"]}
      />
      <InputText
        id="background"
        label="background"
        type="background"
        classInput={`${style.input} ${style.color}`}
        classLabel={style.label}
        classInputContainer={style["form__list"]}
      />

      {/* <div className={style["form__list"]}>
        <label className={style.label} htmlFor="name">
          name
        </label>
        <input className={style.input} id="name" type="text" />
      </div> */}
      {/* <div className={style["form__list"]}>
        <label className={style.label} htmlFor="email">
          email
        </label>
        <input className={style.input} id="email" type="email" />
      </div> */}
      {/* <div className={style["form__list"]}>
        <label className={style.label} htmlFor="password">
          password
        </label>
        <input className={style.input} id="password" type="password" />
      </div> */}
      <div className={style["form__list"]}>
        <label className={style.label} htmlFor="background">
          background
        </label>
        <input
          className={`${style.input} ${style.color}`}
          id="background"
          type="color"
        />
      </div>
      <Button type="submit" className={style.btn}>
        change
      </Button>
    </form>
  );
}

export default SettingAccount;
